'use strict';

/**
* Image of boats in a river in Nagasaki.
*
* @module @stdlib/datasets/img-nagasaki-boats
*
* @example
* var image = require( '@stdlib/datasets/img-nagasaki-boats' );
*
* var img = image();
* // returns <Buffer>
*/

// MODULES //

var IS_BROWSER = require( '@stdlib/assert/is-browser' );


// MAIN //

var image;
if ( IS_BROWSER ) {
	image = require( './browser.js' );
} else {
	image = require( './nagasaki_boats.js' );
}


// EXPORTS //

module.exports = image;
